inpt = """



"""

buttons = """            
    1               
   234               
  56789                
   ABC                  
    D                    
                        """.split("\n")

def get_index(num):
    return int(num.imag), int(num.real)


start = 2 + 3j
for line in inpt.split("\n"):
    for c in line:
        if c == "U":
            new_start = start - 1j
            if 0 < new_start.imag < len(buttons):
                if buttons[int(new_start.imag)][int(new_start.real)] != " ":
                    start -= 1j
        if c == "D":
            new_start = start + 1j
            if 0 < new_start.imag < len(buttons):
                if buttons[int(new_start.imag)][int(new_start.real)] != " ":
                    start += 1j
        if c == "L":
            new_start = start - 1
            if 0 < new_start.real < len(buttons[1]):
                if buttons[int(new_start.imag)][int(new_start.real)] != " ":
                    start -= 1
        if c == "R":
            new_start = start + 1
            if 0 < new_start.real < len(buttons[1]):
                if buttons[int(new_start.imag)][int(new_start.real)] != " ":
                    start += 1
    print(buttons[int(start.imag)][int(start.real)])
